import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Set viewport to a mobile size to ensure the mobile menu is visible
    await page.setViewportSize({ width: 375, height: 667 });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_mobile_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_mobile_view.png'));

    // --- Open the mobile menu ---
    // The menu trigger is a div with class "nav-menu" and text "All"
    const menuTrigger = page.locator('div.nav-menu:has-text("All")');
    await menuTrigger.waitFor({ state: 'visible', timeout: 5000 });
    await menuTrigger.click();

    // Wait for the mobile menu overlay to become visible
    const mobileMenuOverlay = page.locator('#mobileMenuOverlay');
    await mobileMenuOverlay.waitFor({ state: 'visible', timeout: 5000 });

    // Take screenshot with the menu open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_menu_open.png'));

    // --- Interact with a menu item ---
    // Click on the "Clothing & Shoes" link within the menu
    const clothingLink = page.getByRole('link', { name: 'Clothing & Shoes' });
    await clothingLink.waitFor({ state: 'visible', timeout: 5000 });
    const clickedLinkText = await clothingLink.textContent();
    await clothingLink.click();

    // --- Close the mobile menu ---
    // Find and click the close button (using the first one available)
    const closeButton = page.locator('button.close-mobile-menu').first();
    await closeButton.waitFor({ state: 'visible', timeout: 5000 });
    await closeButton.click();

    // Wait for the mobile menu overlay to be hidden
    await mobileMenuOverlay.waitFor({ state: 'hidden', timeout: 5000 });

    // Take a final screenshot to confirm the menu is closed
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_menu_closed.png'));

    return {
      success: true,
      action: "Successfully opened, interacted with, and closed the mobile menu.",
      extractedData: {
        clickedMenuItem: clickedLinkText.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, take a final screenshot for debugging
    const errorScreenshotPath = path.join(screenshotsDir, 'error_state.png');
    await page.screenshot({ path: errorScreenshotPath });

    return {
      success: false,
      action: "Failed to test mobile menu navigation",
      extractedData: {},
      screenshots: [errorScreenshotPath],
      error: error.message
    };
  }
}
